post.description:
type 속성을 통해 사용자 분류를 구분한다.

사용자 분류에 따라 포함하는 속성이 달라진다.

다른 속성값은 null, "" 등의 속성 기본값이 사용되지만 email, phone은 OauthProfile 정보가 기본값으로 사용된다.

사업자의 경우, phone 정보가 필수다.

OauthProfile phone 정보가 없고, 인증코드도 요청에 포함하지 않았다면 요청은 실패한다.

